import QuizSetup from './QuizSetupPage.js';
import './App.css';
import { useState } from 'react';


function Header(){
  return (
    <h1>Quizzitch</h1>
  )
}

function NavBar(){
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>My Quizzes</li>
        <li>Settings</li>
      </ul>
    </nav>
  )
}

function Button({btnName}){
  return (
    <button>
      {btnName}
    </button>
  )
}

function SearchBar (){
  return (
      <input type="text" placeholder="Search..."/>
  )
}

function Footer(){
  return(
    <p>&copy; shauvia</p>
  )
}



function App() {
  return (
    <>
      <header>
        <Header/>
        <NavBar/>
      </header>
      <Button btnName={"Create New Quiz"}></Button>
      <Button btnName={"Recent Quizzes"}></Button>
      <SearchBar/>
      <QuizSetup/>
      <Footer/>
    </>
  )
}

